import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Click on profile link to access user profile
    const profileLink = await page.waitForSelector('a:has-text("Your Profile")');
    await profileLink.click();
    await page.waitForLoadState('networkidle');
    await page.waitForTimeout(1000);

    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_profile_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_profile_page.png'));

    // Extract user profile information
    const profileData = await page.evaluate(() => {
      const fullName = document.querySelector('.profile-info h2')?.textContent?.trim() || '';
      const username = document.querySelector('.username')?.textContent?.trim() || '';
      const bio = document.querySelector('.bio')?.textContent?.trim() || '';

      const stats = Array.from(document.querySelectorAll('.stat')).map(stat => {
        const number = stat.querySelector('.stat-number')?.textContent?.trim() || '';
        const label = stat.querySelector('.stat-label')?.textContent?.trim() || '';
        return { [label]: number };
      });

      // Extract product listings by the user
      const products = Array.from(document.querySelectorAll('.products-grid .product-card')).map(product => {
        return {
          title: product.querySelector('.product-title')?.textContent?.trim() || '',
          price: product.querySelector('.product-price')?.textContent?.trim() || '',
          rating: product.querySelector('.stars')?.textContent?.trim() || ''
        };
      });

      // Extract user reviews
      const reviews = Array.from(document.querySelectorAll('.reviews-list .review-item')).map(review => {
        return {
          product: review.querySelector('.review-product-title')?.textContent?.trim() || '',
          rating: review.querySelector('.stars')?.textContent?.trim() || '',
          title: review.querySelector('.review-title')?.textContent?.trim() || '',
          date: review.querySelector('.review-date')?.textContent?.trim() || ''
        };
      });

      return {
        fullName,
        username,
        bio,
        statistics: Object.assign({}, ...stats),
        products,
        reviews
      };
    });

    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_profile_data.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_profile_data.png'));

    return {
      success: true,
      action: "Successfully harvested user profile information including personal details, statistics, products, and reviews",
      extractedData: profileData,
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to harvest user profile information",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
